    data: |
      SELECT + col0 * col0 + - 88 * - 69 / ( - col2 ) * - - col2 * + - 0 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE 3 BETWEEN - 43 AND NULL;
  - name: tab2

outputs:
  - name: q4095.out
    data: |
